import numpy as np
import scipy.stats as st
import matplotlib.pyplot as plt
import multiprocessing as mp

np.random.seed(0)

def loss(theta, x):
    return (theta - x)**2

def online_gue(data, alpha):
    thetahats = np.zeros(len(data)+1)
    omega_hats = np.zeros(len(data))
    omegas = np.linspace(0, 10, 1000)
    boot_iters = 100

    for n in range(len(data)):
        coverages = np.zeros(len(omegas))
        thetahats[n+1] = np.mean(data[:n+1])
        for _ in range(boot_iters):
            # Bootstrap the first n data points
            choices = np.random.choice(range(n+1), size = n+1, replace = True)
            boot_data = data[choices]

            # Estimate the bootstrapped thetahats
            boot_thetahats = np.zeros(len(boot_data)+1)
            boot_sum = 0
            for idx, boot_datum in enumerate(boot_data):
                boot_sum += boot_datum
                boot_thetahats[idx+1] = boot_sum/(idx+1)

            # Compute the GUe-value on the first n-1 points, since the learning rate is already determined
            log_gue_nminus1 = sum([omega_hats[i]*(loss(boot_thetahats[i], boot_data[i]) - loss(thetahats[n], boot_data[i])) for i in range(n-1)])

            for idx, omega in enumerate(omegas):
                log_gue = log_gue_nminus1 + omega*(loss(boot_thetahats[n], boot_data[n]) - loss(thetahats[n], boot_data[n]))
                coverages[idx] += log_gue < np.log(1/alpha)
        coverages /= boot_iters
        best_omega = omegas[np.argmin([abs(alpha - (1-coverage)) for coverage in coverages])]
        omega_hats[n] = np.mean(np.append(omega_hats[:n], best_omega)) #* (1-0.9**(n+1))


    return omega_hats

def covmatch(data, alpha = None):
    omega_hats = np.zeros(len(data))
    thetahats = np.zeros(len(data)+1)
    for n in range(len(data)):
        thetahats[n+1] = np.mean(data[:n+1])
        best_omega = 0.25/np.mean([(thetahats[n] - x)**2 for x in data[:n+1]])**2
        #print(best_omega)
        #best_omega = 0.33
        #omega_hats[n] = np.mean(np.append(omega_hats[:n], best_omega))
        omega_hats[n] = best_omega
    return omega_hats

